# Write a program that outputs the string representation of numbers from 1 to n.## But for multiples of three it should output “Fizz” instead of the number and# for the multiples of five output “Buzz”. For numbers which are multiples of both three and five output “FizzBuzz”.class Solution(object):    def fizzBuzz(self, n):        """        :type n: int        :rtype: List[str]        """        output = []        for i in range(n):            if (i + 1) % 15 == 0:                output.append("FizzBuzz")            elif (i + 1) % 5 == 0:                output.append("Buzz")            elif (i + 1) % 3 == 0:                output.append("Fizz")            else:                output.append(str(i + 1))        return output